import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import datasurvey from "./datasurvey";

class ver extends Component {
  state = {
    fields: {}
  };

  onChange = updatedValue => {
    this.setState({
      fields: {
        ...this.state.fields,
        ...updatedValue
      }
    });
  };

  render() {
    return (
      <div className="ver">
        <datasurvey onChange={fields => this.onChange(fields)} />
        <p>
          Firstname :{this.state.fields}
        </p>
      </div>
    );
  }
}

export default ver;
